import React, { ReactNode } from 'react';
import './Messagerie.css';

const MainFrame = ({
	title,
	children,
}: {
	title: string;
	children: ReactNode;
}) => {
	return (
		<div className="main-frame">
			<h1>{title}</h1>
			{children}
		</div>
	);
};

export const Messagerie = () => {
	return (
		<div className="messagerie-wrapper">
			<MainFrame title="Messagerie">
				<p></p>
			</MainFrame>
		</div>
	);
};
